import React from "react";

const NotFound = () => {
  return (
    <div className="not-found">
      <h1 >Error 404</h1>
      <h2 >Page Not Found</h2><br/>
      <h3 >The requested URL was not found in this server.</h3>
    </div>
  );
};

export default NotFound;
